                <div className="col-md-2">
                  {/* An icon button with class "x-button" that triggers the onClickClose function when clicked */}
                  <FontAwesomeIcon
                    className="x-button"
                    icon={faXmarkCircle}
                    onClick={onClickClose}
                  />
                </div>
              </div>
            ) : null}
          </div>
        ) : null}
        {/* If showResults is false, display the container with class "nkkelhullet-food-negResult-container" */}
        {showResults === false && (
          <div className="container nkkelhullet-food-negResult-container">
